/**
 * Represents the different phases of intercepting network requests and responses.
 * @enum {string}
 */
const InterceptPhase = {
  BEFORE_REQUEST_SENT: 'beforeRequestSent',
  RESPONSE_STARTED: 'responseStarted',
  AUTH_REQUIRED: 'authRequired',
}

